social_posts.post_text:
‘152’ album out now. 10 records produced by me with @takingbacksunday 

Forever grateful to @adamdamnlazzara , @thejohnnolan , @markoconnelltbs & @shaunwcooper for welcoming me so openly into their process & world. Seemed like an insane choice, not least to me but thank you for letting me play a part. From our first session in Charlotte (ty Steve Aoki!) to sessions in Vegas, LA & Phoenix, making this record was a whole movie - good bad and ugly but always in the challenge of making it better.

Coming into this album, I can’t claim to have been anywhere as knowledgable as a true emo fan, but I quickly realized in conversations how much this band meant and continues to mean to so many people.

We treated every decision on this record with care and respect to that legacy, but hopefully in a way that represents what TBS is now and can be in the future. The classics aren’t going anywhere, but we love where we’re headed.

Extra thanks to the whole squad that pulled this together with us. @therealnealavron - mix god / icon
@matthewkelleryes - Additional production, mixing, and our not so secret weapon on so many of these records. A true scholar and legend
Engineers - @kyleblackmusic , @grayfoxaudio , @rynoserious_ , @aleceitrem , @frankmitaritonna 
@nickmontopoli strings on ‘Amphetamine Smiles’
@jilliannewla - tytyty for everything

S/O @fantasyrecords absolutely crushing the lead up here 💿

@chelsaves tyty 📈 

@presonus Studio One passes the stress testing on a band record! 🚀💻

152! 🍾
